import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import { HashRouter, Route } from "react-router-dom";
import UserContext from "./coomponents/context.jsx";
import Home from "./pages/home.jsx";
import CreateAccount from "./pages/createaccount.jsx";
import Deposit from "./pages/deposit.jsx";
import Withdraw from "./pages/withdraw.jsx";
import AllData from "./pages/alldata.jsx";
import reportWebVitals from "./pages/reportWebVitals";
import NavTabs from "./components/nav.jsx";
import "bootstrap/dist/css/bootstrap.min.css";
import { initializeParse } from "@parse/react";

initializeParse(
  "http://localhost:1337/parse",
  "6yTvfeQsqXzIomLJuLJ7t8bn3HnZMvkBhd21wXZs",
  "qgX3533kBcyikvHasOJhDx3Exbxscfw4PR6kW1pS"
);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <HashRouter>
      <NavTabs />
      <UserContext.Provider value={{ users: [] }}>
        <div className="container" style={{ padding: "20px" }}>
          <Route path="/" exact component={Home} />
          <Route path="/CreateAccount/" component={CreateAccount} />
          <Route path="/deposit/" component={Deposit} />
          <Route path="/withdraw/" component={Withdraw} />
          <Route path="/alldata/" component={AllData} />
        </div>
      </UserContext.Provider>
    </HashRouter>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
